import axios from 'axios';
import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

const FeedbackDetails = () => {
  const { id } = useParams();
  const [feedback, setFeedback] = useState(null);

  useEffect(() => {
    axios.get(`http://localhost:3000/feedback/${id}`) // Adjust URL to match your backend endpoint
      .then(response => {
        setFeedback(response.data); // Assuming your backend returns JSON data of the feedback details
      })
      .catch(error => {
        console.error('Error fetching feedback details:', error);
      });
  }, [id]);

  if (!feedback) {
    return <p>Loading...</p>; // Add loading state if needed
  }

  return (
    <div className="bg-gray-100 min-h-screen p-6">
      <h2 className="text-2xl font-bold mb-4">Feedback Details</h2>
      <div className="bg-white shadow-lg rounded-lg p-6">
        <p><strong>Aspect:</strong> {feedback.aspect}</p>
        <p><strong>Satisfaction Level:</strong> {feedback.satisfaction_level}</p>
        <p><strong>Improvement Suggestions:</strong> {feedback.improvement_suggestions}</p>
      </div>
    </div>
  );
};

export default FeedbackDetails;
